import React from 'react';
import { Image, Container, Grid } from 'semantic-ui-react';

function ShaneGear() {
    return(
        <Container className="shane-about" textAlign="left">
            <Grid columns={3}>
                <Grid.Row>
                    <Grid.Column>
                        <b>Camera: </b>Canon 7D <br />
                        <Image src={require("../../../images/canon.png")} size="tiny" />
                    </Grid.Column>
                </Grid.Row>
            </Grid>


        </Container>
    )
}

export default ShaneGear;
